  /submitCreators:
    post:
      tags:
        - General operation
      summary: Submit Creators
      description: |-
        CreatorDB supports submitting creators on the following platforms:
        * YouTube
        * Instagram
        * TikTok
      operationId: ''
      parameters:
        - name: apiId
          in: header
          required: true
          schema:
            type: string
            example: LE6DPZQkR3TQShxofXoD2j8qCBu1-f0jti665m1t50dwDD12W
          examples:
            default:
              value: LE6DPZQkR3TQShxofXoD2j8qCBu1-f0jti665m1t50dwDD12W
      requestBody:
        description: |-
          Submit new creators to the CreatorDB database. Please include the following in your request body:

          ```json
          {
